import React from 'react';
import './App.css';

import Background from './assets/headerBackground.jpg'

const styles = {
  section: {
    backgroundImage: `url(${Background})`
  },
}

import 
{
  Header,
  AboutMe,
  Resume,
  Projects,
  Slideshow,
  Contact
} from './components/index.js'

function App() {
  return (
    <div className="App">
      <header className="App-header" style = {styles.section}>
        < Header />
      </header>

        < AboutMe />
        < Resume />
        < Projects />
        < Slideshow />
        < Contact />
    </div>
  );
}

export default App;
